import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 64 64" {...props}><path fill="#fff" d="M9 9h10V4H4v15h5V9zM54 19h5V4H44v5h10v10zM55 45v10H45v5h15V45h-5z" /><path className="aw-theme-iconOutline" fill="#fff" d="M10 45H5v15h15v-5H10V45z" /></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 64 64">  <g>    <polygon points="9 9 19 9 19 4 4 4 4 19 9 19 9 9" fill="#fff"/>    <polygon points="54 19 59 19 59 4 44 4 44 9 54 9 54 19" fill="#fff"/>    <polygon points="55 45 55 55 45 55 45 60 60 60 60 45 55 45" fill="#fff"/>    <polygon points="10 45 5 45 5 60 20 60 20 55 10 55 10 45" class="aw-theme-iconOutline" fill="#fff"/>  </g></svg>';
        export const SvgComponent = React.memo(SvgComp);
